sbol:ComponentDefinition.sbh:mutableDescription:
This composite part is the union of:
*a PoPS in -> cI, lasR out device and
*a Plambda-regulated luxR protein generator.

It is a module of the following genetic multiplexer (mux):
{|align="center"
|[[Image:Pv_mux_final.png|500px]]
|-
|[[Image:pv_muxregistry_interactions.png|500px]]
|}
where:
*PA, PS and PB are three promoters that can be ACTIVATED by the three generic elements A, S and B respectively;
*GOI is the ''gene of interest'' that is the output of the system.

In particular, '''K081003 is the Selector'''.

People who want to use the genetic mux have to assemble:
*K081000 under the desired regulation for Channel 0 (for example the generic promoter PA);
*K081001 under the desired regulation for Channel 1 (for example the generic promoter PB);
*K081002 under the desired regulation for Selector (for example the generic promoter PS);
*the desired protein generator downstream of K081000 and K081001 (for example the generic RBS-GOI-T generator);
